import React from "react";

const GameListComp = ({ games }) => (
  <div>
    {games.map((game, index) => (
      <div key={index}>
        <h3>{game.title}</h3>
        <p>{game.platform}</p>
        <a href={game.game_url} target="_blank" rel="noopener noreferrer">
          Game URL
        </a>
      </div>
    ))}
  </div>
);

export default GameListComp;
